LL,'I\'m So Confused',NULL,NULL,NULL,NULL,NULL,NULL,0,0,NULL),(329,2,NULL,NULL,NULL,NULL,NULL,NULL,1966,NULL,NULL,'testalbum2',NULL,NULL,NULL,NULL,NULL,NULL,0,0,NULL);
DROP TABLE IF EXISTS `recordingcomment`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `recordingcomment` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `recordingfk` int(11) DEFAULT NULL,
  `username` text,
  `text` text,
  `timestamp` datetime DEFAULT NULL,
  `bob` int(11) DEFAULT NULL,
  `voterank` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `recordingfk` (`recordingfk`),
  CONSTRAINT `recordingcomment_ibfk_1` FOREIGN KEY (`recordingfk`) REFERENCES `recording` (`id`)
);
